import React,{useState} from 'react'

function Admin() {
    const [name, setName] = useState('')
    const [price, setprice] = useState('');
    const [image, setImage] = useState('')
    const [description, setDescription] = useState('')
  return (
    <div>
        <input type="text" onChange={(e)=>setName(e.target.name)} name='name' placeholder='name' />
        <input type="number" onChange={(e)=>setprice(e.target.price)} name='price' placeholder='name' />
        <input type="text" onChange={(e)=>setImage(e.target.image)} name='image' placeholder='name' />
        <input type="text" onChange={(e)=>setDescription(e.target.description)} name='description' placeholder='name' />
    </div>
  )
}

export default Admin
